import React, { useState, useEffect } from "react";
import Grid from "@material-ui/core/Grid";
import ObraSocialForm from "./ObraSocialForm";
import { makeStyles } from "@material-ui/core/styles";
export default function ObraSocial() {
  const classes = useStyles();
  const [obrasSociales, setObrasSociales] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/obraSocial", {
      method: "GET",
      headers: { "Content-Type": "application/json" },
    })
      .then((response) => response.json())
      .then((data) => setObrasSociales({ postId: data.id }));
  }, []);

  return (
    <Grid container>
      <Grid item xs={12} sm={6} md={6} lg={6} className={classes.listaOS}>
        LISTA DE OBRASOCIALES
      </Grid>
      <Grid item xs={12} sm={6} md={6} lg={6} className={classes.borderForm}>
        <ObraSocialForm />
      </Grid>
    </Grid>
  );
}
const useStyles = makeStyles((theme) => ({
  borderForm: {
    borderLeft: "1px solid #000",
    height: "100%",
  },
  listaOS: {
    height: "100%",
  },
}));
